import logo from './logo.svg';
import me from './assets/jyp.jpg';
import './App.css';

function App() {

  let greeting = "Allo!"
  let letter = [];
  for (var i = 0; i < greeting.length; i++) {
    letter[i] = greeting[i];
  }

  return (
    <div className="App">
      <div className='introBlock'>
        <p className="intro">
          <span className='letter1'>{letter[0]}</span>
          <span className='letter2'>{letter[1]}</span>
          <span className='letter3'>{letter[2]}</span>
          <span className='letter4'>{letter[3]}</span>
          <span className='letter5'>{letter[4]}</span>
        </p>
      </div>
      <div className='greetingBlock'>
        <p className='greeting'>만나서 반가워요!</p>
      </div>
      <div className='imgBlock'>
        <img src={me} className="profile" alt="logo" />
      </div>
      <div className='textBlock'>
        <p className='name'> 안녕하세요! 저는 박주영이라고 해요.</p>
        <p className='like'> 저는 노는 것, 만드는 것, 그리고 고기 먹는걸 좋아해요.</p>
        <p className='goal'> 이번 학기 목표는 전공에 대한 자신감을 갖게 되는 거에요.</p>
        <p className='ntmy'> 잘 부탁해요!</p>
      </div>

    </div>
  );
}

export default App;
